import React from 'react'
import styled from 'styled-components';

const Anchor = styled.a`
  color: #FFC759;
  font-size: 12px;
  font-weight: medium;
`;

const AnchorLink = () => {

         return <Anchor href="">Link</Anchor>
}

export default AnchorLink;
